import './style.css';

function OpenScreen() {
  return (
   <section>
    <circle dx="100" dy="100" r="30" fill='lime'/>
     <svg>
     </svg>
    <div className='wrapper'>
      <h1 className='portfolio'>Portfolio</h1>
      <div className="img-container"></div>
      <div className="text">
      <p>Merhaba,</p>
      <span>Ben</span>
      <h3 className='firstName'>Alişan</h3>
      </div>
      <button className='homeBtn'>İncele</button>
    </div>
    <small>Bu kişisel bir portfolio dur</small>
   </section>
  )
}

export default OpenScreen;
